{"1": ["Пришли гнутые но сразу это не обнаружили стали выпрямлять (из за того что все тонкое и мягкое ) сломались  не рекомендую . ЕРУНДА!!!!!", "2020-01-22T07:28:14.694124523Z", "серебристый", "0", 1, 0, 1, "Серьги", "Серебро России"], "2": ["Серьги садик красивые, дочка хотела на день рождения именно с божьими коровками, очень понравились именно эти. В итоге отвратительнее ничего ещё не встречала: на серёжках осень хлипкие замки, постоянно приходилось их проверять не расстегнулись ли. Ну и результат недельной носки на фото... Дочь снимала футболку и одна сережка просто разломилась пополам...было море слез на весь вечер и конечно же на долго испорченное настроение. Ну покупайте, не тратьте деньги на ветер!", "2019-11-04T03:51:21.077646106Z", "серебристый", "0", 4, 1, 1, "Серьги", "Серебро России"], "3": ["Сережки очень красивые, но пришли с браком! Поэтому отказ. Одна погнутая. Замок не фиксируется ни у одной, очень жаль.", "2019-07-03T17:24:02.966569255Z", "серебристый", "0", 2, 0, 2, "Серьги", "Серебро России"], "4": ["Сережки пришли деформированные, даже в замок лапка не входила... Раздавленные.... Хотела сфотографировать, но на фото деформация оказалась не видна....", "2019-07-02T13:57:34.116309908Z", "серебристый", "0", 3, 0, 1, "Серьги", "Серебро России"], "5": ["Не прошло и месяца,а замки на серьгах не закрываются.", "2019-02-22T14:22:00.95179447Z", "серебристый", "0", 4, 0, 3, "Серьги", "Серебро России"], "7": ["Серёжки очень красивые, но на следующий день перестали работать оба замка(((за то снимаю две звезды", "2019-03-10T10:45:40.598767209Z", "серебристый", "0", 4, 0, 3, "Серьги", "Серебро России"], "8": ["Застёжка никак не фиксируется. Очень ждали их, очень милые и яркие. Но...отказ.", "2019-02-15T08:44:25.304364279Z", "серебристый", "0", 3, 0, 1, "Серьги", "Серебро России"], "9": ["Замечательные, изумительные, милые очень. Заказываю уже третий раз. Сначала младшей дочке, потом старшей. Потеряли одну сережку заказала опять. Жалко не могу нигде их в золоте найти. У нас были. Тоже потеряли одну. Наверно, никогда с ними не расстанусь) Лишь бы в продаже были)", "2019-01-08T22:59:07.578840901Z", "серебристый", "0", 0, 1, 5, "Серьги", "Серебро России"], "10": ["Взяла в подарок девочке 5-ти лет. Замечательные! Очень грациозные!", "2018-08-11T16:44:09.754572305Z", "серебристый", "0", 1, 0, 5, "Серьги", "Серебро России"]}
